import "bootstrap/dist/css/bootstrap.min.css";
import "./shards-dashboard/styles/shards-dashboards.1.1.0.min.css";

function App() {
  return (
      <DefaultLayout>
           <TotalStats/>
        </DefaultLayout>
  );
}

export default App;
